def get_reverse_complement(dna_string):
    # 1. Create a translation table for the complements
    # 'A' becomes 'T', 'T' becomes 'A', 'C' becomes 'G', 'G' becomes 'C'
    translation_table = str.maketrans("ATCG", "TAGC")
    
    # 2. Translate the string to get the complement
    complement = dna_string.translate(translation_table)
    
    # 3. Reverse the string using slice notation [::-1]
    reverse_complement = complement[::-1]
    
    return reverse_complement

